-- ----------------------------
-- Function structure for genorderno
-- ----------------------------
DROP FUNCTION IF EXISTS `genorderno`;
delimiter ;;
CREATE FUNCTION `genorderno`()
 RETURNS varchar(14) CHARSET utf8mb4 COLLATE utf8mb4_unicode_ci
  READS SQL DATA 
BEGIN
      DECLARE vOrderNo VARCHAR(14);
			DECLARE vMonth VARCHAR(2);
			DECLARE iNo INTEGER;
			
			SELECT
				`order`.OrderNo
			INTO
				vOrderNo
			FROM
				`order`
			ORDER BY
				`order`.OrderNo DESC
			LIMIT 1;
			
			IF MONTH(NOW()) < 10 THEN
				SET vMonth = CONCAT('0',MONTH(NOW()));
			ELSE
				SET vMonth = CONCAT(MONTH(NOW()));
			END IF;
			
			IF vOrderNo IS NULL THEN
				RETURN CONCAT('O-',YEAR(NOW()),'M',vMonth,'00001');
			END IF;
			
			SET iNo = CONVERT(SUBSTRING(vOrderNo, -5), SIGNED INTEGER) + 1;
						
      RETURN CONCAT('O-',YEAR(NOW()),'M',vMonth, SUBSTRING(CONCAT('0000',iNo),-5));
    END
;;
delimiter ;

