DROP TRIGGER IF EXISTS `before_insert_order_orderno`;
delimiter ;;
CREATE TRIGGER `before_insert_order_orderno` BEFORE INSERT ON `order` FOR EACH ROW SET new.OrderNo = `genorderno`()
;;
